`,paraId:10,tocIndex:2},{value:"Transform occurs when submitting, generally speaking, it is spit out the data stored in the database to the backend.",paraId:11,tocIndex:3},{value:"For the convenience of everyone, both ",paraId:12,tocIndex:3},{value:"ProFormDependency",paraId:12,tocIndex:3},{value:" and ",paraId:12,tocIndex:3},{value:"formRef",paraId:12,tocIndex:3},{value:" support ",paraId:12,tocIndex:3},{value:"transform",paraId:12,tocIndex:3},{value:", which can get the transformed value.",paraId:12,tocIndex:3},{value:`<ProFormDependency>
